        function handleFileSelectPrediction(evt, model) 
            {
                $('.loader').show();
                $('#pred_results').html("")

                var file = evt[0].files[0];
                name = file.name
                var reader = new FileReader();
                reader.onload = (function(theFile) {
                        return function(e) {
                            dataURL = e.target.result;
                            var data = 
                                {
                                    'filedata': dataURL,
                                    'model' : model
                                }
                            console.log(data);
                            requestToEngine(data)
                        };
                })(file);	
                reader.readAsDataURL(file);
            }

    
        function requestToEngine(data){
            settings = requestObjectFunc(predictURL, "POST")
            settings['data'] = JSON.stringify(data, null, '\t')

            $.ajax(settings).done(function (response) {
                
                // $('#table_div').show();
                // console.log(response)

                console.log("new response", response);

                if(response['status'] == true){

                    $('.loader').hide();
                    $('#pred_results').html("")
                    $('#powerbi-viz').show();

                    pred_df = response['pred_df']

                    // let pred_df = pred_df_resp.map(obj => new Map(Object.entries(obj)));
                    // console.log("pred df: ", pred_df)
                    
                    
                    keys = Object.keys(pred_df[0])
                    console.log("df keys: ", keys)

                    tr= '<tr>'
                    for(i=0; i<keys.length; i++)
                        tr += '<th>'+ keys[i] + '</th>'
                    tr += '</tr>'
                    $('#pred_results').append(tr)

                    for(i=0; i<pred_df.length; i++){
                        tr = '<tr>'
                        for(j=0; j<keys.length; j++){
                            key = keys[j]
                            value = pred_df[i][key]
                            // console.log(key,value)

                            if(key == 'Y_Failure_Prediction'){
                                if(value == 0)
                                    tr += '<td><img src="../static/Images/wrong_mark.png" style="width:25px; margin: 0 40%"/></td>'
                                else
                                    tr += '<td><img src="../static/Images/right_mark.png" style="width:25px; margin: 0 40%" /></td>'
                            }
                            else if(key == 'risk_prob'){
                                if (value <= 0.25){
                                    tr += '<td><img src="../static/Images/normal.png" style="width:25px; margin: 0 40%"/></td>'
                                } else if( 0.25 < value <= 0.5){
                                    tr += '<td><img src="../static/Images/moderate.PNG" style="width:25px; margin: 0 40%"/></td>'
                                } else if (0.5 < value <= 0.75){
                                    tr += '<td><img src="../static/Images/critical.png" style="width:25px; margin: 0 40%"/></td>'
                                } else {
                                    tr += '<td><img src="../static/Images/danger1.png" style="width:25px; margin: 0 40%"/></td>'
                                }
                            }
                            else{
                                tr += '<td>' + value + '</td>'
                            }                                
                        }
                        tr += '</tr>'
                        $('#pred_results').append(tr)
                    }

                    $('.loader').hide();
                    $('#table_div').show();
                    
                }
                else
                    alert(response['error'])
                    // $('#table_div').hide();
                    // $('#pred_results').html("")
                    $('#powerbi-viz').hide();

                
            });

        }
    
    
    
        // request object to flask API
        function requestObjectFunc(url, method){
            var settings = {
                  "async": true,
                  "crossDomain": true,
                  "url": url,
                  "method": method,
                  "headers": {
                    "content-type": "application/json",
                    "cache-control": "no-cache"
                  },
                  "processData": false,
                  "error": function (xhr, ajaxOptions, thrownError) {
                            if(xhr.status != 200)
                                {
                                    alert('Error in Web service');
                                }
                            }
                }
            return settings
        }

    
